import { Route, Routes } from "react-router-dom";

import Register from './register';
import Login from './login';

function App() {
  return (
    <div >
      <Routes>
       <Route exact path="/" element={<Register />} />
       <Route path="/login" element={<Login />} />
     </Routes>
    </div>
  );
}

export default App;
